import React from 'react'
import {InputUI} from '../../../UIComponents/mu-inputs'
import {SearchSvg} from '../../../Icons/Search'
import {OrgSearchInputWrapper} from '../atoms'

export const OrgsSearchInput = () => {
    return (
        <OrgSearchInputWrapper>
            <InputUI
                icon={<SearchSvg/>}
            />
        </OrgSearchInputWrapper>
    )
}
